const getUrl=(text)=>{
    var Url =(text.match(/(https?:\/\/[^\s]+)/g))
    return !Url ? null : (
      <div>
        <ul>
          {
            Url.map(item =>{
              <li>{item}</li>    
            })
          }
        </ul>
      </div>
    )
  }
  export default getUrl;
